import React from "react";
import Col from "react-bootstrap/Col";

const Cards = (props) => {
  const storyHeading = {
    textAlign: "center",
    fontSize: "40px",
    letterSpacing: "2px",
    borderBottom: "1px solid #dedede",
    paddingBottom: "5px",
  };
  return (
    <div className="wrap-around">
      <h1 style={storyHeading}>{props.storyHeading}</h1>
    </div>
  );
};

export default Cards;
